import React from 'react';
import { connect } from "react-redux";
import * as creator from '../store/actions/itineraryActions.js';

class CityPage extends React.Component {

    componentDidMount() {
        const location = window.location.pathname.replace("/", "");
        this.props.getCity(location);
    }

    render() {
        return (
            <div>
                <p className="cityName">  </p>
                <div className="content">
                    <p className="cityHeadline">Available MYtineries</p>
                </div>
            </div>
        );
    }
}

const mapStateToProps = (state) => {
    return {city: state.city, cityIsLoading: state.cityIsLoading};
}

const mapDispatchToProps = dispatch => {
    return {
        getCity: name => dispatch(creator.fetchCityData(name)),
    }
}

export default connect(mapStateToProps, mapDispatchToProps) (CityPage);
